import React from 'react';

const CharacterItem = props => {
  const {} = props;

  return (
    <Box p={5} shadow="md" borderWidth="1px" {...rest}>
      <Heading fontSize="xl">{title}</Heading>
      <Text mt={4}>{desc}</Text>
    </Box>
  );
};

export default CharacterItem;
